import React from 'react';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemText from '@material-ui/core/ListItemText';
import Avatar from '@material-ui/core/Avatar';
import WorkIcon from '@material-ui/icons/Work';
import ListItem from '@material-ui/core/ListItem';
import ImageIcon from '@material-ui/icons/Image';
import List from '@material-ui/core/List';
import Stack from '@mui/material/Stack';
import CreateNewFolderIcon from '@material-ui/icons/CreateNewFolder';
import { IconButton } from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import DownloadIcon from '@mui/icons-material/Download';
import FileUploadIcon from '@mui/icons-material/FileUpload';

export default function DeckList() {

  return (
    <div style={{ display: 'inline-block', padding: 30 }}>
      <Stack spacing={1} direction="row" style={{alignItems: 'center'}}>
        <IconButton style={{ height: '30px', width: '80px', borderRadius: 3, backgroundColor: '#008BD9' }}>
          <AddIcon style={{fill:'white'}}/>
        </IconButton>
        <IconButton>
          <CreateNewFolderIcon />
        </IconButton>
        <IconButton style={{ padding: 0 }}>
          <DownloadIcon />
        </IconButton>
        <IconButton style={{ padding: 7 }}>
          <FileUploadIcon />
        </IconButton>
      </Stack>
      <List>
      <ListItem>
        <ListItemAvatar>
          <Avatar><ImageIcon /></Avatar>
        </ListItemAvatar>
        <ListItemText primary="Photos"
        secondary="Photos Icon" />
      </ListItem>
      <ListItem>
        <ListItemAvatar>
          <Avatar><WorkIcon /></Avatar>
        </ListItemAvatar>
        <ListItemText primary="Work"
        secondary="Work Icon" />
      </ListItem>
    </List>
    </div>
  );
}
